function local = localiza(l_patio,id_conteiner,caso) % localiza posio e no contedo.

[altura,largura]=size(l_patio);
c_local = 1; % inicializando um contador.
local = cell(0);

% Ordem que vai percorrer
  for a_cont = (-altura:-1)  %corrigindo a ordem de verificao. Comeando de baixo.
        a_aux = a_cont * -1;
        %ao contrario para soluciar o problema de pegar posicoes flutuantes
        %quando se busca lugares vazios
    for l_cont = (-largura:-1)
            l_aux = l_cont*-1;
            
     if ((l_patio{a_aux,l_aux}(1) ~= 0) || (caso == 1))
         
      if (l_patio{a_aux,l_aux}(caso) == id_conteiner) 
                local(c_local) = {[a_aux,l_aux]}; % Inserir
                c_local = c_local + 1;    % lista de vazios/contineres (posio no ptio)
      end
      
     end       
    end
  end
end

function local = localizaTaxa4(l_patio,id_conteiner,caso,destinostaxa4) % localiza posio e no contedo.

[altura,largura]=size(l_patio);
local = zeros(1,destinostaxa4);

% Ordem que vai percorrer
  for a_cont = (-altura:-1)  %corrigindo a ordem de verificao. Comeando de baixo.
        a_aux = a_cont * -1;
        %ao contrario para soluciar o problema de pegar posicoes flutuantes
        %quando se busca lugares vazios
    for l_cont = (-largura:-1)
            l_aux = l_cont*-1;
            
     if ((l_patio{a_aux,l_aux}(1) ~= 0) || (caso == 1))
         
      if (l_patio{a_aux,l_aux}(caso) == id_conteiner) 
                local(l_patio{a_aux,l_aux}(2)) = local(l_patio{a_aux,l_aux}(2))+1;
      end
      
     end       
    end
  end
end

%Funo para retornar a taxa de ocupao de um ptio

function [taxa] = ocupacao(l_patio)

todos = numel(l_patio);  %Quantidades de espaos do ptio.

meu_local = localiza(l_patio,0,1); %qtd espacos vazios

vazios = numel(meu_local);  % Quantidade de itens do 'caso' => caso  uma lista com posies ocupadas
 
taxa = (todos-vazios)/todos;  %todos-vazios = ocupados/todos

display(todos);
display(todos-vazios);

display(taxa);

end

%Funo para retornar a quantidade de contineres de cada navio de destino no ptio
function [taxa2] = cont_patio(l_patio,navio)
   
     meu_local = localiza(l_patio,navio,1);
     taxa2 = numel(meu_local);

 
end


%Funo para retornar a quantidade de contineres de cada destino no navio

function [taxa3] = cont_navio_destino(l_patio,porto)
   
     meu_local = localiza(l_patio,porto,2);
     taxa3 = numel(meu_local);

 
end

function [taxa4] = cont_destino_navio(l_patio,navio,destinostaxa4)
   
     taxa4 = localizaTaxa4(l_patio,navio,1,destinostaxa4);
     
end
